# Function to clean and extract product details
def extract_product_details(raw_data):
    products = []
    for item in raw_data:
        data = item[0]

        # Extract discount percentage
        discount = re.search(r'(\-\d+%)', data)
        discount = discount.group(0) if discount else None

        # Extract product name by looking for a pattern of multiple newlines followed by the product name and then a price
        product_name_match = re.search(r'\n{2,}([^\n]+)\n{2,}Rs\. \d+\.\d{2}', data)
        product_name = product_name_match.group(1).strip() if product_name_match else None

        # Extract prices
        prices = re.findall(r'Rs\. \d+\.\d{2}', data)
        original_price = prices[0] if prices else None
        discounted_price = prices[1] if len(prices) > 1 else None

        # Extract description by looking for text between the product name and the first price occurrence
        description_start_index = product_name_match.start() if product_name_match else None
        description_end_index = data.find(prices[0]) if prices else None
        description = data[description_start_index + len(product_name_match.group(0)):description_end_index].strip() if description_start_index and description_end_index else None

        products.append({
            'Discount': discount,
            'Product Name': product_name,
            'Original Price': original_price,
            'Discounted Price': discounted_price,
            'Description': description
        })

    return products

# Process the raw data
organized_data = extract_product_details(raw_data)

# Print organized data
for product in organized_data:
    print(product)